def nonOrderPairCount(board, size):
    count = 0
    for x in range(0, size):
        for y in range(x + 1, size):
            if board[x] != "_" and board[y] != "_":
                if board[x] > board[y]:
                    count += 1
    return count
                

def parity(board, size):
    m = []
    y = []
    non = nonOrderPairCount(board, len(board))
    for x2 in range(0, len(board)):
        y.append(board[x2])
        if x2 % int(size) == (int(size) - 1):
            m.append(y)
            y = []
        x = 0
    y = 0
    b = False
    size = int(size)
    for x2 in range(0, size):
        for x3 in range(0, size):
            if m[x2][x3] == '_':
                x = x2
                y = x3
                b = True
            if b:
                break
        if b:
            break
    if size % 2 == 0:
        if x % 2 == 0 and non % 2 == 1:
            return True
        elif x % 2 == 1 and non % 2 == 0:
            return True
        else:
            return False
    else:
        if non % 2 == 0:
            return True
        else:
            return False
def find_goal(board):
    s = ""
    for x in board:
        if x != "_":
            s += x
    s = ''.join(sorted(s)) 
    s += "_"
    return s

def swap(x, y, x2, y2, m):
    m2 = m
    temp = m2[x][y]
    m2[x][y] = m2[x2][y2]
    m2[x2][y2] = temp
    return m2

def tostr(m):
    temp = ""
    for x in range(len(m)):
            temp += ''.join(m[x])
    return temp

def directionchildren(board, size):
    m5 = []
    y = []
    m9 = []
    for x2 in range(0, len(board)):
        y.append(board[x2])
        if x2 % int(size) == (int(size) - 1):
            m5.append(y)
            y = []
    boardset = set()
    x = 0
    y = 0
    b = False
    size = int(size)
    for x2 in range(0, size):
        for x3 in range(0, size):
            if m5[x2][x3] == '_':
                x = x2
                y = x3
                b = True
            if b:
                break
        if b:
            break
    if x > 0:
        temp = swap(x, y, x - 1, y, m5)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m9.append("U")
        m5 = swap(x, y, x - 1, y, m5)
    if y > 0:
        temp = swap(x, y, x, y - 1, m5)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m9.append("L")
        m5 = swap(x, y, x, y - 1, m5)
    if x < size - 1:
        temp = swap(x, y, x + 1, y, m5)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m9.append("D")
        m5 = swap(x, y, x + 1, y, m5)
    if y < size - 1:
        temp = swap(x, y, x, y + 1, m5)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m9.append("R")
        m5 = swap(x, y, x, y + 1, m5)
    return m9

def get_children(board, size):
    m = []
    y = []
    for x2 in range(0, len(board)):
        y.append(board[x2])
        if x2 % int(size) == (int(size) - 1):
            m.append(y)
            y = []
    boardset = set()
    x = 0
    y = 0
    b = False
    size = int(size)
    for x2 in range(0, size):
        for x3 in range(0, size):
            if m[x2][x3] == '_':
                x = x2
                y = x3
                b = True
            if b:
                break
        if b:
            break
    if x > 0:
        temp = swap(x, y, x - 1, y, m)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m = swap(x, y, x - 1, y, m)
    if y > 0:
        temp = swap(x, y, x, y - 1, m)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m = swap(x, y, x, y - 1, m)
    if x < size - 1:
        temp = swap(x, y, x + 1, y, m)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m = swap(x, y, x + 1, y, m)
    if y < size - 1:
        temp = swap(x, y, x, y + 1, m)
        temp2 = tostr(temp)
        boardset.add(temp2)
        m = swap(x, y, x, y + 1, m)
    return boardset

def findCoordinate(value, board, size):
    x = board.index(value)
    return (x / size, x % size)

def scrambleBoard(board):
    board = list(board)
    random.shuffle(board)
    return ''.join(board)

def heuristic(startstate):
    size = int(len(startstate) ** 0.5)
    count = 0
    for x in startstate:
        if x != "_":
            y, y1 = findCoordinate(x, startstate, size)
            z, z1 = findCoordinate(x, find_goal(startstate), size)
            y2 = abs(y - z)
            z2 = abs(y1 - z1)
            count += y2 + z2
    return count 

def astar2(startstate, totalDepth):
    closed = set()
    startnode = (heuristic(startstate), 0, startstate, [startstate])      
    fringe = []
    deletedFringe = []
    heappush(fringe, startnode)
    while len(fringe) > 0:
        f, depth, v, path = heappop(fringe)
        deletedFringe.append((f, depth, v, path ))
        if depth == totalDepth:
            path.append(v)
            for d in deletedFringe: 
                if d not in fringe: fringe.append(d)
            return [depth, path, fringe] 
        if v not in closed:
            c_path = path.copy()
            c_path.append(v)
            closed.add(v)
            for c in get_children(v, int(len(startstate) ** 0.5)):
                if c not in closed:
                    temp = (depth + 1 + heuristic(c), depth + 1, c, c_path)
                    heappush(fringe, temp)
    return None
